import React from 'react';

import Shelf from './components/shelf';
// import Filter from './components/shelf/components/Filter';

const Shop = () => {
  const titleStyle = {
    borderBottom: "2px solid #fff",
    maxWidth: "500px",
    margin: "auto",
    padding: "10px"
}

  return (
    <React.Fragment>
      {/* <Filter /> */}
      <div className='row mt-6 d-block text-center mb-5' style={titleStyle}>
        <h1>Store</h1>
      </div>
      <div className="row d-block">
      <Shelf />
      </div>
    </React.Fragment>
  )
};

export default Shop;
